import React, { useState, useEffect } from 'react';
import { View } from 'react-native';

const Main: React.FC = () => {
    const [members, setMembers] = useState([]);

    useEffect(() => {
        fetch('https://api.github.com/orgs/rocketset/members').then(response => {
            response.json().then(data => {
                setMembers(data);
            })
        })
    })
    return <View />;
};

export default Main;
